import '../../styles/Premise.css';
import house from '../../img/my_house.webp';

function PremiseInfo({premise}) {
	if (!premise || !premise.DescriptionCharacteristicRef || !premise.DescriptionCharacteristicRef.Characteristic) {
		return <div>Loading...</div>; // Или любое другое сообщение о загрузке
	  }

	return (
			<div className="premiseInfo">
				<img src={house} className="premisePicture"/>
				<p className="namePremise">{premise.Name}</p>
				<p className="adressPremise">{premise.Address}</p>
				<div className="descriptionPremise">
					{premise.DescriptionCharacteristicRef.map((des) => (
						<div>
							<p className="hyesos">XXX:</p>
							<p className="pidoras">{des.Description}</p>
						</div>
					))}
				</div>
			</div>
  	);
}

export default PremiseInfo;
